INSERT INTO `product` VALUES (68,_binary '','https://cdn.tgdd.vn/Products/Images/44/231244/apple-macbook-air-2020-mgn63saa-280323-125154.jpg','Laptop Apple MacBook Air M1 2020 thuộc dòng laptop cao cấp sang trọng có cấu hình mạnh mẽ, chinh phục được các tính năng văn phòng lẫn đồ hoạ mà bạn mong muốn, thời lượng pin dài, thiết kế mỏng nhẹ sẽ đáp ứng tốt các nhu cầu làm việc của bạn.\nChip Apple M1 tốc độ xử lý nhanh gấp 3.5 lần thế hệ trước\nChiếc MacBook này được trang bị con chip Apple M1 được sản xuất độc quyền bởi Nhà Táo trên tiến trình 5 nm, 8 lõi bao gồm 4 lõi tiết kiệm điện và 4 lõi hiệu suất cao, mang đến một hiệu năng kinh ngạc, xử lý mọi tác vụ văn phòng một cách mượt mà như Word, Excel, Powerpoint,... thực hiện tốt các nhiệm vụ chỉnh sửa hình ảnh, kết xuất 2D trên các phần mềm Photoshop, AI,... máy còn hỗ trợ tiết kiệm được điện năng cao.\n',18490000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/v2tc3c5raq?alt=media&token=ae95c7cc-c314-4996-b79a-32901775d6f6',18990000,4,'Laptop Apple MacBook Air 13 inch M1 2020 8-core CPU8GB256GB7-core GPU (MGN63SAA)',39,67),(80,_binary '','https://cdn.tgdd.vn/Products/Images/44/282827/apple-macbook-air-m2-2022-161122-112213.jpg','Sau 14 năm, ba lần sửa đổi và hai kiến trúc bộ vi xử lý khác nhau, kiểu dáng mỏng dần mang tính biểu tượng của MacBook Air đã đi vào lịch sử. Thay vào đó là một chiếc MacBook Air M2 với thiết kế hoàn toàn mới, độ dày không thay đổi tương tự như MacBook Pro, đánh bật mọi rào cản với con chip Apple M2 đầy mạnh mẽ.\nLột xác ngoạn mục với thiết kế thời thượng, sang trọng \nSự đẳng cấp đến từ ngoại hình của chiếc MacBook Air nhà Apple là điều không thể phủ nhận và khó có dòng sản phẩm cùng phân khúc nào có thể qua mặt được.',26490000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/hhfcdfi3hkg?alt=media&token=dba3d91e-c60a-4fb4-96d6-71502c2f8c1d',27090000,12,'Laptop Apple MacBook Air 13 inch M2 2022 8-core CPU8GB256GB8-core GPU (MLXY3SAA)',39,67),(88,_binary '','https://cdn.tgdd.vn/Products/Images/42/299033/iphone-15-pro-131023-034959.jpg','Lý do chọn mua iPhone 15 Pro Max tại Thế Giới Di Động\niPhone 15 Pro Max là một chiếc điện thoại thông minh cao cấp được mong đợi nhất năm 2023. Với nhiều tính năng mới và cải tiến, iPhone 15 Pro Max chắc chắn sẽ là một lựa chọn tuyệt vời cho những người dùng đang tìm kiếm một chiếc điện thoại có hiệu năng mạnh mẽ, camera chất lượng và thiết kế sang trọng.\n\n• Sản phẩm chính hãng, đảm bảo chất lượng: Thế Giới Di Động là nhà bán lẻ điện thoại di động lớn nhất Việt Nam, cam kết cung cấp sản phẩm chính hãng, đảm bảo chất lượng. Bạn có thể yên tâm về xuất xứ sản phẩm và có thể tận hưởng trải nghiệm sử dụng tốt nhất.\n\n• Ưu đãi và khuyến mãi hấp dẫn: Thế Giới Di Động thường xuyên có các chương trình khuyến mãi, giảm giá và tặng quà kèm, giúp bạn tiết kiệm được một khoản tiền khi mua iPhone 15 Pro Max.',33990000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/09j36ln7aso?alt=media&token=a88e692c-e867-412c-8142-0edfb8cc0176',34990000,18,'iPhone 15 Pro Max 256GB',40,46),(92,_binary '','https://cdn.tgdd.vn/Products/Images/42/303812/iphone-15-512gb-131023-110624.jpg','iPhone 15 Plus thu hút mọi ánh nhìn ngay khi ra mắt nhờ có vẻ ngoài cao cấp, trang bị bộ xử lý mạnh mẽ, cụm camera kép đặc trưng cho khả năng chụp ảnh cực nét cùng màn hình chất lượng cao, để bạn tận hưởng trải nghiệm sử dụng tuyệt vời. \nDiện mạo vuông vắn sang trọng\nNăm nay, Apple vẫn sẽ tiếp tục sử dụng kiểu thiết kế vuông vắn dành cho thế hệ iPhone trong năm 2023, giúp tạo cảm giác cứng cáp và độc đáo. Màn hình của chiếc điện thoại này cũng được thiết kế phẳng, mang đến một cái nhìn thú vị và hiện đại hơn bao giờ hết. Thiết kế này không chỉ mang đến vẻ đẹp độc đáo, mà còn tối ưu hóa trải nghiệm người dùng khi cầm nắm sản phẩm.\n\niPhone 15 Plus tiếp tục thể hiện sự cố gắng của Apple trong việc sáng tạo và sử dụng chất liệu cao cấp. Chiếc điện thoại iPhone này có khung nhôm chắc chắn, tạo sự độc đáo và đẳng cấp.\n',24990000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/2rjb93658qg?alt=media&token=0f42e8b0-a9c2-4380-a540-ff9f073f2257',25990000,10,'iPhone 15 Plus 128GB',40,46),(99,_binary '','https://cdn.tgdd.vn/Products/Images/44/309016/apple-macbook-air-m2-2023-070623-044421.jpg','MacBook Air 15 inch M2 2023 đã có phiên bản cải tiến vừa được nhà Apple cho ra mắt, thêm không gian cho những điều bạn yêu với màn hình Liquid Retina 15 inch ấn tượng. Với người dùng yêu thích hiệu năng \"nhanh như chớp\" trong một thiết kế siêu gọn nhẹ của dòng Air thì đây chắc chắn là một sản phẩm bạn không nên bỏ qua.\nMàn hình Retina 15 inch lớn ấn tượng \nVới phiên bản 2023, Macbook Air được nâng cấp màn hình lên 15.3 inch, được trang bị tấm nền IPS cùng độ phân giải Liquid Retina (2880 x 1864) giúp những khung hình được tái hiện hoàn hảo',30290000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/bihelbdgre8?alt=media&token=effc23b9-8502-4f6d-8ae3-7edd37627e8a',31290000,14,'Laptop MacBook Air 15 inch M2 2023 8CPU8GB256GB10GPU (MQKU3SAA',39,67),(103,_binary '','https://cdn.tgdd.vn/Products/Images/86/308679/chuot-khong-day-gaming-rapoo-vt960s-thumb-600x600.jpg','Chuột không dây Gaming Rapoo VT960s sở hữu thiết kế như siêu xe thời trang, chất liệu bền bỉ, trang bị đèn LED đẹp mắt, phù hợp với các bạn hay chơi game, hứa hẹn mang đến cho người dùng những trải nghiệm tối ưu.\n• Kiểu dáng chuột năng động và mạnh mẽ với các đường cắt được ghép với nhau một cách hoàn hảo, nâng cấp vẻ đẹp cho không gian giải trí và làm việc của bạn. \n\n• Tốc độ quét IPS 400 cho phản hồi nhạy bén, hỗ trợ tốt trải nghiệm chơi game hay các thao tác trong thiết kế đồ hoạ, tạo nên trải nghiệm sử dụng đã tay nhất cho người dùng.\n\n• Ngoài ra, độ phân giải từ 50 - 19000 DPI có thể thoải mái điều chỉnh sao cho phù hợp với nhu cầu sử dụng của bạn, nhờ vậy chuột không chỉ dành cho các game thủ mà những người dùng văn phòng cơ bản hay học sinh/sinh viên cũng có thể sử dụng.\n\n• Chuột Rapoo còn kết nối với laptop thông qua dây cắm USB với chiều dài 180 cm vô cùng tiện lợi.',1590000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/1avfjsmdi0g?alt=media&token=da0345e6-e6b7-481f-a8f0-7207f10f821f',1690000,8,'Chuột không dây Gaming Rapoo VT960s',41,110),(112,_binary '','https://cdn.tgdd.vn/Products/Images/86/299931/chuot-khong-day-logitech-silent-signature-m650-size-m-thumb2-1-600x600.jpeg','Chuột Không dây Bluetooth Silent Logitech Signature M650 sở hữu kiểu dáng công thái học cùng độ phân giải lớn, đáp ứng tốt gần như mọi nhu cầu từ sử dụng cơ bản tới những tác vụ chuyên nghiệp của người dùng.\n• Thiết kế gọn đẹp, vừa tay, màu sắc thời thượng, lịch lãm, viền bên được lót thêm miếng cao su giúp cầm và sử dụng chuột chắc chắn hơn.\n\n• Chuột không dây này có thể kết nối được với phần lớn các máy tính hiện nay nhờ tương thích với các hệ điều hành phổ biến: Windows và macOS.\n\n• Độ phân giải lên tới 4000 DPI, cho phản hồi cực kỳ nhanh chóng và chính xác.\n\n• Kích thước chuột cỡ vừa (size M), phù hợp với kích cỡ tay của phần đông người dùng (chiều dài tay khoảng 17.5 cm - 19 cm).\n\n• Phím nhấn và con lăn được chế tác chỉn chu, cuộn siêu nhanh, click dễ dàng. Thêm vào đó, công nghệ SilentTouch giúp giảm hiệu quả tiếng ồn khi nhấp chuột, cho phép bạn tập trung hơn vào công việc.\n',765000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/jlseifok1gg?alt=media&token=7dcd64fa-b807-4dc5-8861-47b8fe88d16f',850000,11,'Chuột Không dây Bluetooth Silent Logitech Signature M650',41,48),(116,_binary '','https://cdn.tgdd.vn/Products/Images/44/302520/Kit/lenovo-yoga-duet-7-13itl6-i7-82ma009pvn-note.jpg','Laptop Lenovo Yoga Duet 7 13ITL6 i7 (82MA009PVN) độc đáo với thiết kế linh hoạt, cho phép bạn sử dụng máy như một chiếc laptop làm việc đầy năng suất hay một chiếc tablet giúp thỏa mãn mọi nhu cầu giải trí.\n• Bộ vi xử lý Intel Core i7 1165G7 và card tích hợp Intel Iris Xe Graphics hỗ trợ bạn vận hành mượt mà cho các công việc như lập trình, chỉnh sửa video và chơi game nhẹ. Đồng thời cho phép bạn chạy các tác vụ đồ họa ở mức trung bình.\n\n• RAM 16 GB giúp laptop Lenovo Yoga hoạt động mượt mà khi chạy nhiều tác vụ cùng lúc. SSD 1 TB hỗ trợ bạn lưu trữ hàng trăm hoặc hàng nghìn tập tin, video, nhạc, ảnh,... mà không lo bị hết không gian lưu trữ.',31490000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/lnfa3jif8u?alt=media&token=a277d6ad-0465-4a23-8399-28f2e3c36ed3',36490000,7,'Laptop Lenovo Yoga Duet 7 13ITL6 i7 1165G716GB1TBTouchPenWin11 (82MA009PVN)',39,47),(178,_binary '','https://cdn.tgdd.vn/Products/Images/44/274921/Kit/asus-tuf-gaming-fx517zc-i5-hn077w-note.jpg','Sở hữu ngoại hình ấn tượng thu hút mọi ánh nhìn cùng hiệu năng mạnh mẽ đến từ laptop CPU thế hệ 12 mới nhất,\n Asus Gaming TUF Dash F15 FX517ZC i5 (HN077W) là lựa chọn xứng tầm cho mọi nhu cầu chiến game giải trí hay đồ hoạ -\n kỹ thuật của người dùng.\n• Laptop Asus TUF mang hiệu năng vượt trội cho khả năng giải quyết trơn tru các tác vụ phức tạp như thiết kế hình ảnh,\n render video,... trên các ứng dụng nhà Adobe hay thoả sức chiến các tựa game hot như CS:GO, GTA V,... \nnhờ trang bị chip Intel Core i5 Alder Lake 12450H cùng card rời NVIDIA RTX 3050, 4 GB.',24690000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/ech5uf7vulo?alt=media&token=3f12e8d5-97d9-42aa-917a-9c20afadfa44',27990000,17,'Laptop Asus Gaming TUF Dash F15 FX517ZC i5 12450H8GB512GB4GB RTX3050144HzWin11',39,45),(182,_binary '','https://cdn.tgdd.vn/Products/Images/44/279259/Kit/asus-tuf-gaming-fx506lhb-i5-hn188w-note.jpg','Nếu bạn đang tìm kiếm một chiếc laptop gaming nhưng vẫn sở hữu một mức giá phải chăng thì laptop Asus TUF Gaming FX506LHB i5 (HN188W) \nsẽ là sự lựa chọn đáng cân nhắc với card đồ họa rời NVIDIA GeForce GTX mạnh mẽ cùng phong cách thiết kế cứng cáp, độc đáo. \n• Chạy mượt mà các ứng dụng văn phòng trên Word, Excel, PowerPoint,... đến chiến những con game đình đám nhờ bộ vi xử lý Intel Core i5 10300H \nkết hợp với card đồ họa rời NVIDIA GeForce GTX 1650 4 GB mạnh mẽ. ',16190000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/9of20c7nl7?alt=media&token=9ef951c6-14e2-41a2-9db8-7ce824233650',18990000,15,'Laptop Asus TUF Gaming F15 FX506LHB i5 10300H8GB512GB4GB GTX1650144HzWin11',39,45),(186,_binary '','https://cdn.tgdd.vn/Products/Images/44/285771/Kit/asus-zenbook-14-oled-ux3402za-i7-km221w-note.jpg','Laptop Asus Zenbook 14 OLED UX3402ZA i7 (KM221W) sở hữu ngoại hình thanh lịch, màn hình OLED 2.8K tỷ lệ 16:10 và bộ vi xử lý Intel Core i7\n thế hệ thứ 12 mạnh mẽ, xứng danh một chiếc laptop học tập - văn phòng cùng mình chinh chiến trong suốt quãng đường đại học.\nCân mọi thể loại tác vụ từ chơi game cho đến thiết kế\nLaptop Asus Zenbook được trang bị bộ vi xử lý Intel Core i7 1260P với cấu trúc 12 nhân và 16 luồng cùng card đồ họa tích hợp \nIntel Iris Xe, không chỉ hỗ trợ mình xử lý mượt mà mọi tác vụ học tập, văn phòng từ cơ bản đến nâng cao mà còn cân luôn các công việc \nchỉnh ảnh, thiết kế trên Photoshop, Canva, Figma,...',26190000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/6p3okent8gg?alt=media&token=d36d9f7f-ecd3-43b5-808c-3a3b8f812c3e',29990000,17,'Laptop Asus Zenbook 14 OLED UX3402ZA i7 1260P16GB512GBCápWin11',39,45),(210,_binary '','https://cdn.tgdd.vn/Products/Images/42/251192/Kit/iphone-14-pro-max-note.jpg','iPhone 14 Pro Max một siêu phẩm trong giới smartphone được nhà Táo tung ra thị trường vào tháng 09/2022. Máy trang bị con chip Apple A16 Bionic vô cùng mạnh mẽ, đi kèm theo đó là thiết kế hình màn hình mới, hứa hẹn mang lại những trải nghiệm đầy mới mẻ cho người dùng iPhone.\nThiết kế cao cấp bền bỉ\niPhone năm nay sẽ được thừa hưởng nét đặc trưng từ người anh iPhone 13 Pro Max, vẫn sẽ là khung thép không gỉ và mặt lưng kính cường lực kết hợp với tạo hình vuông vức hiện đại thông qua cách tạo hình phẳng ở các cạnh và phần mặt lưng.',24090000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/ilffa7mfms?alt=media&token=e4dae2ab-f693-46f2-bbb6-69e32790b6e9',25990000,18,'iPhone14 Pro Max 128GB',40,46),(214,_binary '','https://cdn.tgdd.vn/Products/Images/42/247508/Kit/iphone-14-pro-note.jpg','iPhone 14 Pro 128GB - Mẫu smartphone đến từ nhà Apple được mong đợi nhất năm 2022, lần này nhà Táo mang đến cho chúng ta một phiên bản với kiểu thiết kế hình notch mới, cấu hình mạnh mẽ nhờ con chip Apple A16 Bionic và cụm camera có độ phân giải được nâng cấp lên đến 48 MP.\nThiết kế mang dáng vẻ sang trọng và đặc trưng\nĐến với thiết kế của iPhone 14 Pro năm nay, hãng vẫn giữ lại nét đặc trưng vốn có từ các đời trước, vẫn mang trong mình ngoại hình vuông vức với các cạnh và mặt lưng vát phẳng. Hiện tại thị hiếu của người dùng về kiểu thiết kế này vẫn đang rất cao, vậy nên theo mình thấy thì đây vẫn sẽ là chiếc điện thoại bắt trend cho trong nhiều năm tiếp theo.\n',22990000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/2ifkjb32m38?alt=media&token=eaa0c587-c61e-4925-829b-5e7d9edb78a1',24990000,17,'Iphone 14 Pro 128Gb',40,46),(218,_binary '','https://cdn.tgdd.vn/Products/Images/42/240259/Kit/iphone-14-note.jpg','iPhone 14 128GB được xem là mẫu smartphone bùng nổ của nhà táo trong năm 2022, ấn tượng với ngoại hình trẻ trung, màn hình chất lượng đi kèm với những cải tiến về hệ điều hành và thuật toán xử lý hình ảnh, giúp máy trở thành cái tên thu hút được đông đảo người dùng quan tâm tại thời điểm ra mắt.\niPhone 14 sở hữu thiết kế cao cấp\nVới phiên bản tiêu chuẩn thì nhà Apple vẫn giữ nguyên kiểu dáng thiết kế so với thế hệ tiền nhiệm, vẫn là mặt lưng phẳng cùng bộ khung vuông giúp máy trở nên hiện đại hơn',17490000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/kulqs455i78?alt=media&token=56d1f844-2b7f-4727-8f06-f29a274191a4',19990000,18,'Iphone 14 128GB',40,46),(247,_binary '','https://cdn.