ệc và học tập hàng ngày của bạn.\n• Thiết kế bên ngoài vô cùng gọn gàng, màu đỏ chủ đạo nổi bật cùng hoạ tiết chú mèo thần tài dễ thương đem sắc xuân ngập tràn đến cho không gian làm việc của bạn.\n\n• Chuột được chế tác tỉ mỉ, vỏ ngoài chắc chắn cùng kiểu thiết kế mỏng giúp quá trình cất giữ thêm phần tiện lợi.\n\n• Chuột Rapoo với độ phân giải đạt 1300 DPI, cho phép chơi game hay thực hiện các tác vụ chỉnh sửa hình ảnh thông thường vô cùng tốt, đáp ứng yêu cầu cơ bản hàng ngày của bạn.\n\n• Kết nối không dây với 2 cách sau: Sử dụng đầu thu USB hoặc kết nối qua Bluetooth hiện đại, đa dạng sự lựa chọn cho người dùng. Kết nối dễ dàng cho hầu hết các dòng máy trên thị trường nhờ khả năng tương thích với các thiết bị sử dụng hệ điều hành Windows và macOS.',600000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/bq3fpllqq2o?alt=media&token=ebcbaae0-de6f-49c6-88bc-04cc523c01e6',700000,15,'Chuột Không dây Bluetooth Silent Rapoo M650 Lucky Cat',41,110),(351,_binary '','https://cdn.tgdd.vn/Products/Images/42/223602/Kit/iphone-13-n.jpg','Trong khi sức hút đến từ bộ 4 phiên bản iPhone 12 vẫn chưa nguội đi, thì hãng điện thoại Apple đã mang đến cho người dùng một siêu phẩm mới iPhone 13 với nhiều cải tiến thú vị sẽ mang lại những trải nghiệm hấp dẫn nhất cho người dùng.\nHiệu năng vượt trội nhờ chip Apple A15 Bionic\nCon chip Apple A15 Bionic siêu mạnh được sản xuất trên quy trình 5 nm giúp iPhone 13 đạt hiệu năng ấn tượng, với CPU nhanh hơn 50%, GPU nhanh hơn 30% so với các đối thủ trong cùng phân khúc.',15090000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/b4fnkec1b98?alt=media&token=4dd92cff-4ebe-424a-9027-87b4042c9a94',16990000,17,'iPhone 13 128GB',40,46),(355,_binary '','https://cdn.tgdd.vn/Products/Images/42/213031/Kit/iphone-12-note.jpg','Trong những tháng cuối năm 2020, Apple đã chính thức giới thiệu đến người dùng cũng như iFan thế hệ iPhone 12 series mới với hàng loạt tính năng bứt phá, thiết kế được lột xác