us+, mặt kính màn hình chính là Ultra Thin Glass.',21990000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/tt4k66pi6rg?alt=media&token=5dd030b1-de81-42f8-a3c4-527cfc424020',40990000,15,'Điện thoại Samsung Galaxy Z Fold4 5G 256GB',40,251),(541,_binary '','https://cdn.tgdd.vn/Products/Images/86/314638/chuot-khong-day-gaming-rapoo-vt960-pro-9.jpg','Chuột Không Dây Gaming Rapoo VT960 Pro được giới game thủ xem là trợ lý đắc lực cho những trận game, với kiểu dáng hầm hố, gam màu mạnh mẽ, hệ thống đèn LED RGB phong phú, thời lượng pin khủng, độ cảm biến cao, mang đến cho bạn những khoảnh khắc hoàn hảo.\n• Chuột không dây mang đến độ cảm biến quang học lên đến 26000 DPI, cho phép người dùng dễ dàng điều chỉnh phù hợp với từng tựa game.\n\n• Thiết kế chuột vô cùng ấn tượng, phù hợp cho người thuận tay trái và cả tay phải. Chất liệu cứng cáp và bền bỉ, hoạ tiết đẹp mắt, cầm nắm và di chuyển mượt mà.',1350000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/fr3uut4fij8?alt=media&token=3bb367ee-0746-4eaf-94d2-38f6402c12b0',1690000,13,'Chuột Không Dây Gaming Rapoo VT960 Pro',41,110),(542,_binary '','https://cdn.tgdd.vn/Products/Images/86/307841/chuot-co-day-gaming-rapoo-v25s-5.jpg','Chuột Có Dây Gaming Rapoo V25S sở hữu thiết kế đối xứng, độ phân giải lớn phù hợp với mọi game thủ, cảm biến mượt mà, dễ dàng điều khiển khi sử dụng, mang đến cho người dùng những trải nghiệm tốt nhất.\n• Kiểu dáng chuột mang hơi hướng gaming độc đáo, thiết kế công thái học cho phép cầm thoải mái và dễ chịu khi sử dụng lâu dài.\n\n• Hệ thống LED RGB 16 triệu màu cho phép bạn tùy chỉnh màu sắc đèn theo sở thích của bạn, nổi bật cả góc phòng khi sử dụng trong điều kiện thiếu sáng.\n\n• Độ phân giải 200 - 6200 DPI cho phản hồi nhanh chóng và chính xác, sản phẩm phù hợp để sử dụng nhiều mục đích, từ các tác vụ văn phòng cơ bản tới đồ hoạ hay chiến game yêu cầu độ nhạy và chính xác cao.',405000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/si53nui90tg?alt=media&token=519704ce-12d2-4ec1-8326-2125419629c2',450000,18,'Chuột Có Dây Gaming Rapoo V25S',41,110),(543,_binary '','https://cdn.tgdd.vn/Products/Images/44/314840/Kit/dell-inspiron-14-7430-i5-n7430i58w1-glr-note.jpg','Laptop Dell Inspiron 14 7430 i5 1335U (N7430I58W1) sở hữu hiệu năng vượt trội từ con chip Intel gen 13 hiện đại, tính năng gập mở 360 độ độc đáo, đây sẽ là trợ thủ đắc lực sẵn sàng cùng bạn xử lý mọi tác vụ học tập, văn phòng, giải trí khó nhằn.\n• Laptop Dell Inspiron sở hữu CPU Intel Core i5 1335U tân tiến kết hợp cùng card Intel Iris Xe Graphics cung cấp cho máy một hiệu năng mạnh mẽ, không chỉ xử lý dễ dàng mọi tác vụ học tập, văn phòng trên Word, Excel,... mà còn giúp bạn giải trí hay chỉnh sửa hình ảnh, video ngắn với Photoshop, AI,... một cách trơn tru, mượt mà.',23490000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/12mont1pa4?alt=media&token=86e8b1e1-2ea2-4af9-a11e-823562e1f771',24190000,15,'Laptop Dell Inspiron 14 T7430 i5 1335U8GB512GBTouchPenOfficeHSWin11 (N7430I58W1)',39,269),(544,_binary '','https://cdn.tgdd.vn/Products/Images/44/313619/Kit/lenovo-yoga-7-14irl8-i7-82yl006bvn-glr-fix-note.jpg','Dòng laptop Yoga từ nhà Lenovo luôn nổi tiếng với thiết kế mỏng nhẹ, kiểu dáng thanh lịch, sang trọng, tính năng xoay gập và cảm ứng độc đáo mang đến tính tiện lợi trong sử dụng. Laptop Lenovo Yoga 7 14IRL8 i7 1360P (82YL006BVN) được trang bị những tiện ích tân tiến cùng hiệu năng mạnh mẽ, sẽ mang đến cho người dùng những trải nghiệm sử dụng tối ưu nhất.\n• Laptop Lenovo Yoga được trang bị chip Intel Core i7 1360P thuộc thế hệ 13 hoàn toàn mới với xung nhịp tối đa lên đến 5.0 GHz kết hợp cùng card Intel Iris Xe Graphics giúp người dùng vận hành trơn tru các tác vụ từ văn phòng, học tập đến việc thiết kế các ấn phẩm 2D, 3D, render video,... cũng như giải trí với những tựa game nhẹ.',26490000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/vs51psbk5mg?alt=media&token=e60175d5-c828-4d9f-b69a-81fff1cef2d1',28990000,15,'Laptop Lenovo Yoga 7 14IRL8 i7 1360P16GB512GBTouchPenOfficeHSWin11 (82YL006BVN)',39,47),(545,_binary '','https://cdn.tgdd.vn/Products/Images/44/282827/apple-macbook-air-m2-2022-161122-112213.jpg','Sau 14 năm, ba lần sửa đổi và hai kiến trúc bộ vi xử lý khác nhau, kiểu dáng mỏng dần mang tính biểu tượng của MacBook Air đã đi vào lịch sử. Thay vào đó là một chiếc MacBook Air M2 với thiết kế hoàn toàn mới, độ dày không thay đổi tương tự như MacBook Pro, đánh bật mọi rào cản với con chip Apple M2 đầy mạnh mẽ.\nLột xác ngoạn mục với thiết kế thời thượng, sang trọng \nSự đẳng cấp đến từ ngoại hình của chiếc MacBook Air nhà Apple là điều không thể phủ nhận và khó có dòng sản phẩm cùng phân khúc nào có thể qua mặt được.',26590000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/9lnqbjppvj?alt=media&token=c535b6f2-f1e0-4cc5-a6ba-0cbc503f05fa',27090000,13,'Laptop Apple MacBook Air 13 inch M2 2022 8-core CPU8GB256GB8-core GPU (MLY13SAA)',39,67),(546,_binary '','https://cdn.tgdd.vn/Products/Images/42/303812/iphone-15-512gb-131023-110624.jpg','Thế Giới Di Động là một trong những nhà bán lẻ điện thoại di động lớn nhất Việt Nam, cung cấp đa dạng các sản phẩm iPhone 15 chính hãng với mức giá cạnh tranh. Dưới đây là một số lý do khiến bạn nên chọn mua iPhone 15 tại Thế Giới Di Động:\n\n• Chất lượng sản phẩm: Thế Giới Di Động cam kết cung cấp sản phẩm iPhone 15 chính hãng. Điều này giúp bạn yên tâm về chất lượng sản phẩm và được hưởng đầy đủ các quyền lợi bảo hành của Apple.\n\n• Ưu đãi và khuyến mãi: Thế Giới Di Động thường xuyên có các chương trình khuyến mãi, giảm giá và tặng quà kèm theo, giúp bạn tiết kiệm chi phí khi mua sắm.\n',21990000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/bn7urgr7bug?alt=media&token=1727f3c0-e3eb-462f-b0c4-858b9126f3a0',22990000,14,'iPhone 15 128GB',40,46),(547,_binary '','https://cdn.tgdd.vn/Products/Images/42/299033/iphone-15-pro-131023-034959.jpg','iPhone 15 Pro là một trong những chiếc điện thoại thông minh được mong đợi nhất năm 2023. Với nhiều tính năng mới và cải tiến, iPhone 15 Pro chắc chắn sẽ là một lựa chọn tuyệt vời cho những người dùng đang tìm kiếm một chiếc điện thoại cao cấp.\n\n• Chất lượng sản phẩm: Thế Giới Di Động cam kết cung cấp sản phẩm iPhone 15 Pro chính hãng và đảm bảo chất lượng. Điều này giúp bạn yên tâm về xuất xứ sản phẩm và có thể tận hưởng trải nghiệm sử dụng tốt nhất.\n\n• Ưu đãi và khuyến mãi: Thế Giới Di Động thường xuyên có các chương trình khuyến mãi, giảm giá và tặng quà kèm, giúp bạn tiết kiệm được một khoản tiền khi mua iPhone 15 Pro\n',28290000,'https://firebasestorage.googleapis.com/v0/b/graduation-f97dc.appspot.com/o/6ddj2kn2dc8?alt=media&token=c2c20fc7-0deb-4c94-b0e6-a500806b3f4e',28990000,13,'iPhone 15 Pro 128GB',40,46);
